import * as React from "react";
import { Image, Text, View, Button } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { MaterialCommunityIcons } from "@expo/vector-icons";
import { StyleSheet } from "react-native";
import "./profileScreen.css";
import logo from "./app/assets/man.png";
import { block } from "react-native-reanimated";

function HomeScreen() {
  return (
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Text>Home!</Text>
    </View>
  );
}

function ReceiptScreen() {
  return (
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Text>Receipt!</Text>
    </View>
  );
}

const styleAvatar = StyleSheet.create({
  container: {
    alignContent: "center",
    justifyContent: "center",
  },
  image: {
    width: 100,
    height: 100,
    paddingLeft: 50,
    paddingRight: 50,
  },
});

function ProfileScreen() {
  return (
    <View style={{ flex: 1, backgroundColor: "white" }}>
      <View style={styleAvatar.container}>
        <Image source={logo} style={styleAvatar.image}></Image>
      </View>

      <div style={{ padding: "1%" }}>
        <h1 style={{ marginLeft: "10%", fontSize: 20 }}>Profile Name</h1>
      </div>

      <div style={{ padding: "1%" }}>
        <Text style={{ padding: "5%", color: "#e91e63" }}>
          Account Settings
        </Text>
      </div>

      <div style={{ backgroundColor: "white" }} className="btn-group">
        <ul style={{ listStyle: "none" }}>
          <li>
            <button>Change Name</button>
          </li>
          <li>
            <button>Change Address</button>
          </li>
          <li>
            <button>Change Number</button>
          </li>
          <li>
            <button>Change Email</button>
          </li>
          <li>
            <button></button>
          </li>
        </ul>
      </div>
      <Button title="Push Me" color="white"></Button>
    </View>
  );
}

const Tab = createBottomTabNavigator();

function MyTabs() {
  return (
    <Tab.Navigator
      initialRouteName="HomeScreen"
      tabBarOptions={{
        activeTintColor: "#e91e63",
      }}
    >
      <Tab.Screen
        name="HomeScreen"
        component={HomeScreen}
        options={{
          tabBarLabel: "Home",
          tabBarIcon: ({ color, size }) => (
            <MaterialCommunityIcons name="home" color={color} size={size} />
          ),
        }}
      />
      <Tab.Screen
        name="Receipt"
        component={ReceiptScreen}
        options={{
          tabBarLabel: "Add",
          tabBarIcon: ({ color, size }) => (
            <MaterialCommunityIcons name="plus" color={color} size={size} />
          ),
        }}
      />
      <Tab.Screen
        name="Profile"
        component={ProfileScreen}
        options={{
          tabBarLabel: "Profile",
          tabBarIcon: ({ color, size }) => (
            <MaterialCommunityIcons name="account" color={color} size={size} />
          ),
        }}
      />
    </Tab.Navigator>
  );
}

export default function App() {
  return (
    <NavigationContainer>
      <MyTabs />
    </NavigationContainer>
  );
}
